public class InnerDataSourceDocumentEnrichmentConfigurationFactory(Action<Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration>
{

    internal InnerDataSourceHookConfigurationFactory PreExtractionHookConfigurationFactory { get; set; }

    internal InnerDataSourceHookConfigurationFactory PostExtractionHookConfigurationFactory { get; set; }

    protected override Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration Create()
    {
        var documentEnrichmentConfigurationResult = CreateDocumentEnrichmentConfiguration();
        factoryAction?.Invoke(documentEnrichmentConfigurationResult);

        return documentEnrichmentConfigurationResult;
    }

    private Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration CreateDocumentEnrichmentConfiguration()
    {
        var documentEnrichmentConfigurationResult = new Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration();

        return documentEnrichmentConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QBusiness.DataSourceTypes.DocumentEnrichmentConfiguration result)
    {
        base.CreateChildren(result);

        result.PreExtractionHookConfiguration ??= PreExtractionHookConfigurationFactory?.Build();
        result.PostExtractionHookConfiguration ??= PostExtractionHookConfigurationFactory?.Build();
    }

} // End Of Class

